    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE - col2 * + col0 NOT IN ( - 55, + 16, ( + 61 ) * 49 );
  - name: tab1

outputs:
  - name: q13115.out
    data: |
      51	14	96
      85	5	59
      91	47	68
